import React, { useRef, useEffect } from "react";
import PropTypes from "prop-types";
import SRLLightboxThubnailGallery from "./SRLLightboxThubnailGallery";
import { TransitionGroup, CSSTransition } from "react-transition-group";
import ReactScrollWheelHandler from "react-scroll-wheel-handler";

import {
  SRLLightboxContent,
  SRRLLightboxCaption,
  SRLLightboxImageContainer,
  SRLLightboxImage
} from "../styles";

function SRLLightboxSlideComponent({
  source,
  images,
  id,
  handleCloseLightbox,
  handleCurrentImage,
  handleNextImage,
  handlePrevImage,
  caption,
  captionStyle,
  showThumbnails,
  showCaption,
  transitionSpeed
}) {
  const SRLImageContainerRef = useRef();
  // credit: http://www.javascriptkit.com/javatutors/touchevents2.shtml
  let startX;
  let startY;
  let distX;
  let distY;
  let threshold = 150; // required min distance traveled to be considered swipe
  let restraint = 100; // maximum distance allowed at the same time in perpendicular direction
  let allowedTime = 300; // maximum time allowed to travel that distance
  let elapsedTime;
  let startTime;

  function handleTouchChange(x, y, t, r) {
    // FIRST CONDITION
    /* This is, in a way, a method to check if the action is a Swipe...
       if the finger is held by more than 400 milliseconds, maybe that wasn't a swipe */
    if (elapsedTime <= allowedTime) {
      // SECOND CONDITION
      if (Math.abs(x) >= t) {
        if (x <= 0) {
          handleNextImage(id);
        } else if (x >= 0) {
          handlePrevImage(id);
        }
      }
    }
  }

  function handleTouchStart(e) {
    let touchObject = e.changedTouches[0];
    startX = touchObject.pageX;
    startY = touchObject.pageY;
    startTime = new Date().getTime();
  }

  function handleTouchEnd(e) {
    let touchObject = e.changedTouches[0];
    distX = touchObject.pageX - startX;
    distY = touchObject.pageX - startY;
    elapsedTime = new Date().getTime() - startTime;

    // Run the function on touchend
    handleTouchChange(distX, distY, threshold, restraint);
  }

  useOnClickOutside(SRLImageContainerRef, () => handleCloseLightbox());

  return (
    <SRLLightboxContent className="SRLContent">
      <SRLLightboxImageContainer
        showThumbnails={showThumbnails}
        showCaption={showCaption}
        className="SRLImageContainer"
        onTouchStart={e => handleTouchStart(e)}
        onTouchEnd={e => handleTouchEnd(e)}
      >
        <ReactScrollWheelHandler
          upHandler={() => handleNextImage(id)}
          downHandler={() => handlePrevImage(id)}
          disableKeyboard={true}
        >
          <TransitionGroup className="SRLTransitionGroup">
            <CSSTransition
              key={id}
              classNames="image-transition"
              timeout={transitionSpeed}
            >
              <SRLLightboxImage
                ref={SRLImageContainerRef}
                className="SRLImage"
                transitionSpeed={transitionSpeed}
                src={
                  typeof source === "object"
                    ? "https://www.michelec.site/app/uploads/SRL/SRL_LoadingIcon.gif"
                    : source
                }
                alt={caption}
              />
            </CSSTransition>
          </TransitionGroup>
        </ReactScrollWheelHandler>
      </SRLLightboxImageContainer>

      {showCaption && (
        <SRRLLightboxCaption captionStyle={captionStyle} className="SRLCaption">
          <p className="SRLCaption">{caption}</p>
        </SRRLLightboxCaption>
      )}

      {showThumbnails && (
        <SRLLightboxThubnailGallery
          handleCurrentImage={handleCurrentImage}
          currentId={id}
          images={images || []}
        />
      )}
    </SRLLightboxContent>
  );
  // Hook

  function useOnClickOutside(ref, handler) {
    useEffect(
      () => {
        const listener = event => {
          // Do nothing if clicking ref's element or descendent elements
          if (
            !ref.current ||
            ref.current.contains(event.target) ||
            event.target.classList.contains("SRLNextButton") ||
            event.target.classList.contains("SRLPrevButton") ||
            event.target.classList.contains("SRLCloseButton") ||
            event.target.classList.contains("SRLAutoplayButton") ||
            event.target.classList.contains("SRLThumbnails") ||
            event.target.classList.contains("SRLThumb") ||
            event.target.classList.contains("SRLCaption") ||
            event.type === "touchstart" ||
            event.button !== 0
          ) {
            return;
          }

          handler(event);
        };

        document.addEventListener("mousedown", listener);
        document.addEventListener("touchstart", listener);

        return () => {
          document.removeEventListener("mousedown", listener);
          document.removeEventListener("touchstart", listener);
        };
      },
      // Add ref and handler to effect dependencies
      // It's worth noting that because passed in handler is a new ...
      // ... function on every render that will cause this effect ...
      // ... callback/cleanup to run every render. It's not a big deal ...
      // ... but to optimize you can wrap handler in useCallback before ...
      // ... passing it into this hook.
      [ref, handler]
    );
  }
}

SRLLightboxSlideComponent.propTypes = {
  source: PropTypes.oneOfType([PropTypes.string, PropTypes.object]),
  caption: PropTypes.string,
  captionStyle: PropTypes.shape({
    captionColor: PropTypes.string,
    captionFontFamily: PropTypes.string,
    captionFontSize: PropTypes.string,
    captionFontWeight: PropTypes.string,
    captionFontStyle: PropTypes.string
  }),
  showThumbnails: PropTypes.bool,
  showCaption: PropTypes.bool,
  transitionSpeed: PropTypes.number,
  images: PropTypes.array,
  handleCloseLightbox: PropTypes.func,
  handleCurrentImage: PropTypes.func,
  handleNextImage: PropTypes.func,
  handlePrevImage: PropTypes.func,
  id: PropTypes.string
};

export default SRLLightboxSlideComponent;

import React, { useEffect, useState, useCallback, useRef } from "react";
import PropTypes from "prop-types";
import { SRLLightboxGalleryStage } from "./styles";
import SRLLightboxSlideComponent from "./SRLLightboxSlide";
import SRLLightboxControls from "./SRLLightboxControls";

let _findIndex = require("lodash/findIndex");
let _find = require("lodash/find");

const SRLLightboxGallery = ({
  isOpened,
  handleCloseLightbox,
  images,
  selectedImage,
  overlayColor,
  captionStyle,
  buttonsStyle,
  autoplaySpeed,
  transitionSpeed,
  showCaption,
  showThumbnails
}) => {
  const [currentImage, setCurrentImage] = useState(selectedImage);
  const [imagesGallery, ,] = useState(images);
  const [autoplay, setAutoplay] = useState(false);
  // Handle Current Image
  const handleCurrentImage = useCallback(
    id => {
      const imageSelected = _find(imagesGallery, function(i) {
        return i.id === id;
      });
      setCurrentImage({
        source: imageSelected.src,
        caption: imageSelected.alt,
        id: imageSelected.id,
        width: imageSelected.width,
        height: imageSelected.height
      });
    },
    [imagesGallery]
  );

  // Handle Autoplay
  function useInterval(callback, delay) {
    const savedCallback = useRef();

    // Remember the latest callback.
    useEffect(() => {
      savedCallback.current = callback;
    }, [callback]);

    // Set up the interval.
    useEffect(() => {
      function tick() {
        savedCallback.current();
      }
      if (delay !== null) {
        let id = setInterval(tick, delay);
        return () => clearInterval(id);
      }
    }, [delay]);
  }

  useInterval(
    () => handleNextImage(currentImage.id),
    autoplay ? autoplaySpeed : null
  );

  // Handle Next Image
  const handleNextImage = useCallback(
    id => {
      /* We receive the ID of the current image and we want the image after that.
      Let's find the current position of the current image in the array */
      const currentPosition = _findIndex(imagesGallery, function(i) {
        return i.id === id;
      });

      /* The next image will be the next item in the array but it could be "undefined". If it's undefined we know we have reached the end and we go back to he first image */
      const nextImage = imagesGallery[currentPosition + 1] || imagesGallery[0];
      setCurrentImage({
        source: nextImage.src,
        caption: nextImage.alt,
        id: nextImage.id,
        width: nextImage.width,
        height: nextImage.height
      });
    },
    [imagesGallery]
  );

  // Handle Previous Image
  const handlePrevImage = useCallback(
    id => {
      /* We receive the ID of the current image and we want the image after that.
        Let's find the current position of the current image in the array */
      // const currentPosition = imagesGallery.findIndex(i => i.id === id);
      const currentPosition = _findIndex(imagesGallery, function(i) {
        return i.id === id;
      });
      /* The prev image will be the prev item in the array but it could be "undefined" as it goes negative. If it does we need to start from the last image. */
      const prevImage =
        imagesGallery[currentPosition - 1] ||
        imagesGallery[imagesGallery.length - 1];
      setCurrentImage({
        source: prevImage.src,
        caption: prevImage.alt,
        id: prevImage.id,
        width: prevImage.width,
        height: prevImage.height
      });
    },
    [imagesGallery]
  );

  // Handle Navigation With Keys
  const handleLightboxWithKeys = useCallback(
    event => {
      if (event.keyCode === 39) {
        handleNextImage(currentImage.id);
      } else if (event.keyCode === 37) {
        handlePrevImage(currentImage.id);
      } else if (event.keyCode === 27) {
        handleCloseLightbox();
      }
    },
    [currentImage.id, handleCloseLightbox, handleNextImage, handlePrevImage]
  );

  // USE EFFECT
  useEffect(() => {
    // SETS THE CURRENT IMAGE TO THE BE THE FIRST IMAGE
    // This is crucial in case the user uses the provided method to open the lightbox from a link or a button etc...
    if (currentImage.id === undefined) {
      setCurrentImage({
        source: imagesGallery[0].src,
        caption: imagesGallery[0].alt,
        id: imagesGallery[0].id,
        width: imagesGallery[0].width,
        height: imagesGallery[0].height
      });
    }

    // Adds a class to the body to remove the overflow and compensate for the scroll-bar margin
    if (isOpened) {
      document.body.classList.add("SRLOpened");
      document.addEventListener(
        "keydown",
        handleLightboxWithKeys,
        { once: true },
        false
      );
    }

    // Cleans up function to remove the class from the body
    return function cleanUp() {
      document.body.classList.remove("SRLOpened");
      document.removeEventListener("keydown", handleLightboxWithKeys, false);
    };
  }, [handleLightboxWithKeys, imagesGallery, isOpened, currentImage.id]);

  const controls = {
    currentImageId: currentImage.id,
    handleCurrentImage,
    handleNextImage,
    handlePrevImage,
    handleCloseLightbox,
    autoplay,
    autoplaySpeed,
    setAutoplay
  };

  return (
    <SRLLightboxGalleryStage
      className="SRLOuterWrapper"
      overlayColor={overlayColor}>
      <SRLLightboxControls buttonsStyle={buttonsStyle} {...controls} />
      <SRLLightboxSlideComponent
        showThumbnails={showThumbnails}
        captionStyle={captionStyle}
        showCaption={showCaption}
        handleCloseLightbox={controls.handleCloseLightbox}
        handleCurrentImage={controls.handleCurrentImage}
        handleNextImage={controls.handleNextImage}
        handlePrevImage={controls.handlePrevImage}
        transitionSpeed={transitionSpeed}
        images={images}
        isopened={isOpened}
        {...currentImage}
      />
    </SRLLightboxGalleryStage>
  );
};

SRLLightboxGallery.propTypes = {
  isOpened: PropTypes.bool,
  images: PropTypes.array,
  overlayColor: PropTypes.string,
  showThumbnails: PropTypes.bool,
  showCaption: PropTypes.bool,
  captionStyle: PropTypes.shape({
    captionColor: PropTypes.string,
    captionFontFamily: PropTypes.string,
    captionFontSize: PropTypes.string,
    captionFontWeight: PropTypes.string,
    captionFontStyle: PropTypes.string
  }),
  buttonsStyle: PropTypes.shape({
    buttonsBackgroundColor: PropTypes.string,
    buttonsIconColor: PropTypes.string
  }),
  autoplaySpeed: PropTypes.number,
  transitionSpeed: PropTypes.number,
  selectedImage: PropTypes.object,
  handleCloseLightbox: PropTypes.func
};

export default SRLLightboxGallery;

